INSERT INTO `rooms` VALUES (41,NULL,'2025-05-23 03:58:26.473000','Phòng trọ thoáng mát',NULL,'Đà Nẵng',NULL,1,1,3000000.00,30,NULL,'Cho thuê phòng 25m2 đầy đủ tiện nghi gần Đường 30/4, Quảng trường 2/9',6,'129 Đường Nguyễn Khánh Toàn','Đà Nẵng',' Hải Châu',_binary '','Nguyễn Khánh Toàn','Hòa Cường Bắc'),(42,'2025-05-25','2025-05-27 07:32:49.457000','+ Phòng thoáng mát, có cửa sổ, lấy được gió và khí trời tự nhiên\r\n\r\n+ Đầy đủ trang thiết bị: giường, nệm, tủ, bàn ghế, tủ lạnh lớn, bếp điện, điều hòa, nóng lạnh …\r\n\r\n+ Free Wifi\r\n\r\n+ Camera quan sát 24/24\r\n\r\n+ Hệ thống PCCC đạt chuẩn, có báo cháy từng phòng',NULL,'Đà Nẵng',NULL,1,1,3000000.00,30,NULL,'Cho thuê phòng full nội thất. Trung tâm đường Hoàng Diệu. Đà Nẵng.',11,'47  Hoàng Diệu','Thành phố Đà Nẵng','Quận Hải Châu',_binary '','47 Đường Hoàng Diệu','Phường Phước Ninh'),(43,'2025-02-20','2025-05-28 11:27:11.718000','- Thang máy Fuji nhập khẩu êm ái\r\n\r\n- Cửa gỗ rất đẹp, khóa vân tay+ thẻ từ+Số pass\r\n\r\n- Phòng có cửa sổ thoáng, sân thượng rộng để phơi đồ, cửa lưới chống muỗi.\r\n\r\n- Có bếp từ và tủ lạnh.\r\n\r\n- Phòng vệ sinh dạng VIP đầy đủ, có nước nóng lạnh.',NULL,'Đà Nẵng',NULL,1,1,2500000.00,25,NULL,'Cho thuê phòng 25m2 đầy đủ tiện nghi gần Đường 30/4, Quảng trường 2/9',11,'129 Đường Nguyễn Khánh Toàn','Thành phố Đà Nẵng','Quận Hải Châu',_binary '\0','Nguyễn Khánh Toàn','Phường Hòa Cường Bắc'),(44,'2025-05-27','2025-05-28 11:29:52.505000','Phòng trọ cao cấp mới xây, Có bếp, giường ngủ sẵn, gần trung tâm thành phố (Lê Đại Hành - Hà Tông Quyền- Nguyễn Hữu Thọ): cách chợ 100m, cách Trường: ĐH Ngoại Ngữ, Kiến Trúc, Đông Á. CĐ Bách Khoa 5phut . ',NULL,'Đà Nẵng',NULL,1,1,2500000.00,25,NULL,'Nhà trọ Cao cấp Mới xây rất đẹp thoáng mát, Gần Nguyễn Hữu Thọ Và Lê Đại Hành Đà Nẵng',11,'168-05  Hà Tông Quyền','Thành phố Đà Nẵng','Quận Cẩm Lệ',_binary '\0','168-05 Hà Tông Quyền','Phường Khuê Trung'),(45,'2025-05-15','2025-05-28 14:42:29.389000','Phòng trọ cao cấp,đầy đủ tiện nghi:\r